import React from 'react';
import { AppBar, Toolbar, Typography, Button, Container, Box } from '@mui/material';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: '#000000' }}>
      <Container>
        <Toolbar>
          <Box
            component={NavLink}
            to="/"
            sx={{ 
              flexGrow: 1, 
              textDecoration: 'none',
              display: 'block'
            }}
          >
            <Typography
              sx={{ 
                color: '#FFFFFF',
                fontWeight: 'bold',
                letterSpacing: '1px',
                cursor: 'pointer',
                '&:hover': {
                  opacity: 0.8
                }
              }}
            >
              COACH NATION AFRIKA
            </Typography>
          </Box>

          <Box sx={{ display: 'flex', gap: 2 }}>
            <NavLink 
              to="/" 
              style={({ isActive }) => ({
                color: '#FFFFFF',
                textDecoration: 'none',
                opacity: isActive ? 1 : 0.8
              })}
            >
              <Button 
                sx={{ 
                  color: 'inherit',
                  '&:hover': {
                    backgroundColor: 'rgba(255, 255, 255, 0.1)'
                  }
                }}
              >
                Home
              </Button>
            </NavLink>

            <NavLink 
              to="/trainers"
              style={({ isActive }) => ({
                color: '#FFFFFF',
                textDecoration: 'none',
                opacity: isActive ? 1 : 0.8
              })}
            >
              <Button 
                sx={{ 
                  color: 'inherit',
                  '&:hover': {
                    backgroundColor: 'rgba(255, 255, 255, 0.1)'
                  }
                }}
              >
                Trainers
              </Button>
            </NavLink>

            <NavLink 
              to="/booking"
              style={({ isActive }) => ({
                color: '#FFFFFF',
                textDecoration: 'none',
                opacity: isActive ? 1 : 0.8
              })}
            >
              <Button 
                sx={{ 
                  color: 'inherit',
                  '&:hover': {
                    backgroundColor: 'rgba(255, 255, 255, 0.1)'
                  }
                }}
              >
                Book Session
              </Button>
            </NavLink>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Navbar;
